def findSum(s):
    #code here
    sum=0
    temp=""
    for i in s:
        if i.isdigit():
            temp+=i
            #print(temp)
        elif temp=="":
            temp="0"
        else:
            print(temp)
            sum+=int(temp)
            print(sum)
            temp="0"
    return sum + int(temp)

